import { Route, Switch } from "react-router-dom";

import MainNavigation from "./Components/Layout/MainNavigation";
import FoundationsPage from "./Pages/Foundations";
import PackagedAppsPage from "./Pages/PackagedApps";
import VMsDBs from "./Pages/VMsDBs";

function App() {
  // localhost:3000/favorites
  // my-page.com/
  return (
    <div>
      <MainNavigation />
      <Switch>
        <Route path="/" exact>
          <FoundationsPage />
        </Route>
        <Route path="/packaged-apps">
          <PackagedAppsPage />
        </Route>
        <Route path="/vms-dbs">
          <VMsDBs />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
